import React, { useState, useEffect } from 'react';
import { StyleSheet, View, ScrollView, TouchableOpacity, Image } from 'react-native';
import { Text, Button, TextInput, Card, IconButton } from 'react-native-paper';
import { SafeAreaView } from 'react-native-safe-area-context';
import { useNavigation, useFocusEffect } from '@react-navigation/native';
import { supabase } from '../lib/supabase';
import { NavigationProps } from '../navigation.types';

// Import icons
const chatIcon = require('../assets/chat-icon.png');
const archiveIcon = require('../assets/archive-icon.png');

interface ChatItem {
  id: string;
  question: string;
  response: {
    verse: string;
    reference: string;
    relevance: string;
    explanation: string;
  };
  created_at: string;
  is_archived: boolean;
}

export default function Home() {
  const navigation = useNavigation<NavigationProps>();
  const [showHistory, setShowHistory] = useState(true);
  const [searchQuery, setSearchQuery] = useState('');
  const [chats, setChats] = useState<ChatItem[]>([]);
  const [archivedChats, setArchivedChats] = useState<ChatItem[]>([]);
  const [loading, setLoading] = useState(true);

  // Load chats when the screen comes into focus
  useFocusEffect(
    React.useCallback(() => {
      loadChats();
    }, [])
  );

  const handleLogout = async () => {
    try {
      await supabase.auth.signOut();
      navigation.navigate('Login');
    } catch (error) {
      console.error('Error logging out:', error);
    }
  };

  const loadChats = async () => {
    try {
      setLoading(true);
      const { data: { user } } = await supabase.auth.getUser();
      if (!user) {
        console.error('No user found');
        navigation.navigate('Login');
        return;
      }

      console.log('Loading chats for user:', user.id);

      // First, check if the table exists and has the correct structure
      const { data: tableInfo, error: tableError } = await supabase
        .from('chats')
        .select('*')
        .limit(1);

      if (tableError) {
        console.error('Error checking table:', tableError);
        return;
      }

      console.log('Table structure:', tableInfo);

      // Now fetch the actual chats with all fields explicitly specified
      const { data: chatData, error } = await supabase
        .from('chats')
        .select(`
          id,
          user_id,
          question,
          response,
          created_at,
          is_archived
        `)
        .eq('user_id', user.id)
        .order('created_at', { ascending: false });

      if (error) {
        console.error('Error loading chats:', error);
        return;
      }

      console.log('Loaded chats:', chatData);

      if (!chatData) {
        console.log('No chat data returned');
        setChats([]);
        setArchivedChats([]);
        return;
      }

      // Parse the response field if it's stored as a string
      const processedChats = chatData.map(chat => ({
        ...chat,
        response: typeof chat.response === 'string' 
          ? JSON.parse(chat.response)
          : chat.response
      }));

      console.log('Processed chats:', processedChats);

      setChats(processedChats.filter(chat => !chat.is_archived));
      setArchivedChats(processedChats.filter(chat => chat.is_archived));
    } catch (error) {
      console.error('Error in loadChats:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleArchiveToggle = async (chatId: string, currentlyArchived: boolean) => {
    try {
      const { error } = await supabase
        .from('chats')
        .update({ is_archived: !currentlyArchived })
        .eq('id', chatId);

      if (error) {
        console.error('Error toggling archive status:', error);
        return;
      }

      // Reload chats after updating
      loadChats();
    } catch (error) {
      console.error('Error in handleArchiveToggle:', error);
    }
  };

  const startNewChat = () => {
    navigation.navigate('Question');
  };

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView contentContainerStyle={styles.scrollContent}>
        <View style={styles.content}>
          <Image 
            source={require('../assets/logo-full.png')} 
            style={styles.logo} 
            resizeMode="contain"
          />
          <Button mode="contained" onPress={startNewChat} style={styles.button}>
            Start New Chat
          </Button>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000000',
  },
  content: {
    flex: 1,
    padding: 20,
  },
  scrollContent: {
    flexGrow: 1,
  },
  logo: {
    width: '100%',
    height: 159,
    marginTop: 20,
    marginBottom: 30,
  },
  button: {
    backgroundColor: '#FFD9D0',
    padding: 20,
    borderRadius: 12,
    alignItems: 'center',
    justifyContent: 'center',
  },
});
